import React, { Component } from 'react'

export class Tasks extends Component {

    constructor(){
        super();
        this.state = {
            customers: []
        }
    }
    
    componentDidMount(){
        fetch('/api/customers')
            .then(res => res.json())
            .then(customers => this.setState({customers} , () => console.log('customer fethed...' , customers) ));
    }

    render() {
        return (
            <div style={containerStyle} >

                <h1 style={taskHeader}>Taks </h1>
                <ul>
                    {this.state.customers.map(customer =>
                    <li key={customer.id}> { customer.firstName } </li>
                    )}
                </ul>
            </div>
        );
    }
}
const taskHeader = {
    color: 'rgb(51, 51, 51)',
}
const containerStyle = {
    maxWidth: '1440px',
    paddingRight: '15px',
    paddingleft: '15px',
    marginright: 'auto',
    marginLeft: 'auto'
}


export default Tasks;
